          <span className={`${StretchIntroSectionClassName}row__content`}>
            Peter is currently head of design
          </span>

          <span
            className={`${StretchIntroSectionClassName}row__content ${StretchIntroSectionClassName}row__content--separator`}
          />

          <span className={`${StretchIntroSectionClassName}row__content`}>
            at <strong>Anycart</strong>
          </span>
        </div>

        {/* ____________________________________________________________ */}
        {/* Row */}
        <div className={`${StretchIntroSectionClassName}row`}></div>

        {/* ____________________________________________________________ */}
        {/* Row */}
        <div className={`${StretchIntroSectionClassName}row`}></div>
      </div>
    </StretchIntroSectionStyle>
